import React from "react";
import { Map as Maps, Marker } from "pigeon-maps";
import './Map.css';

class Map extends React.Component {
    constructor() {
        super();

        this.state = {
            latitude: 0,
            longetude: 0,
        };
    }

    render() {
        const { latitude, longetude } = this.state;
        return (
            <section className="Maps">
                <Maps height={600} defaultCenter={[50.879, 4.6997]} defaultZoom={5}>
                    <Marker width={50} anchor={[latitude, longetude]} />
                </Maps>
            </section>
        );
    }
}

export default Map;
